  namespace: FoundationaLLM.Client.Core.Interfaces
  summary: >-
    Performs a completion request to the Core API. For session-based requests, set the

    CompletionRequest.SessionId property to the unique identifier for the session.

    Set the property to <a href="https://learn.microsoft.com/dotnet/csharp/language-reference/keywords/null">null</a> or empty for non-session-based requests.

    Session-less completion requests do not maintain message history or data retention in Cosmos DB.
